    return (
        <div class="codingScreenBody">
            <NavBar />
            <div class="header">
                <h1>Python Loops</h1>
            </div>
            <div class="container">
                <div class="question">


                </div>

                <div class="code-editor">

                    
                </div>
                
            </div>
        </div>
    )
}

export default CodingScreen
